import '../css/page5.css';
import React from 'react'
import anime from "animejs";

function Page5(props){
  function animation(){
    anime.timeline().add({
      targets: '#Page5Point1',
      translateX: 0,
      scale: [0,0.7],
      opacity: [0,1],
      duration: 1000,
      easing: 'easeInExpo',
    }).add({
      targets: '#Page5Point1',
      translateX: 150,
      duration: 500,
      easing: 'spring',
      delay: 1000,
    }).add({
      targets: '#Page5Point2',
      scale: [0,0.7],
      translateX: 0,
      opacity: [0,1],
      duration: 500,
      easing: 'easeInExpo',
    }, '-=550').add({
      targets: '#Page5Point2',
      translateX: -150,
      easing: 'spring',
      duration: 1000,
    }).add({
      targets: '#Page5Text1',
      scaleX: [0,1],
      opacity: [0,1],
      easing: "easeInExpo",
    }, '-=1650');
  }
  if(props.display) animation();

  return(
      <div style={{display: props.display?'': 'none'}}>
        <div id="Page5Point1"> 0 </div>
        <div id="Page5Point2"> <span id="Page5Point2Text"> 8 </span> </div>
        <div id="Page5Text1"> We also have a <span id="Yellow"> client </span> that can send value to the node </div>
      </div>
  );
}

export default Page5;
